&lt;p&gt;The &quot;Category&quot; page template renders child pages using a navigation menu above the main body of the page. This layout is useful for complex topics with classifications and subtopics, since you can present multiple related topics with easy access for backtracking or skipping ahead. This template is similar to the &quot;Full Page&quot; template, because it spans the main body content across the entire width of the page and doesn&#39;t include sidebars.&lt;/p&gt;

&lt;p&gt;You can use the main category page to provide an introduction to a complex topic before drilling down into specific concepts on child pages.&lt;/p&gt;

&lt;p&gt;Child pages make use of the &quot;Category Topic&quot; template.&lt;/p&gt;

&lt;p&gt;This is a content page that uses the &quot;Page&quot; page template.&lt;/p&gt;
&lt;p&gt;This page has the open comment policy enabled, so that any user can leave comments, even if they aren&#39;t signed in. You can also have&amp;nbsp;a closed comment policy to allow only authorized users to leave comments.&lt;/p&gt;
&lt;p&gt;You can rate the page using the box to the right.&lt;/p&gt;

